import React, { Component } from 'react';

//props: 
// key (id)
//  id
// home
//  away
//  date
//  timezone
//  location
//  stadium      
class EventTab extends Component {
    //in class eventTab
    render() { 
        return (
            <React.Fragment>
                    <div class="match-up">
                        {this.props.home} 
                        <img src={this.props.homeImg} class="home-img"/>
                         <div>vs</div>  
                        <img src={this.props.awayImg} class="away-img"></img>
                        {this.props.away}
                    </div>

                    <button>Add game</button>

                    <div class="location">
                        {this.props.stadium} {this.props.location}
                    </div>

                    <div class="time">
                        {this.props.date}  at  {this.props.timezone}
                    </div>

            </React.Fragment>
        );
    }
}

export default EventTab;
